import React from 'react'
import './App.css'
import Header from './components/Header/Header'
import Navbar from './components/Navbar/Navbar'
import Pages from './components/Pages/Pages'

function App(props) {
  return (
    <div className="appWrapper">
      <Nav />
      <Navbar />
      <Pages
        store={props.store} />
    </div >
  );
}

export default App;
